import React, { useContext } from 'react';
import { Link, NavLink, withRouter } from 'react-router-dom';
import '../css/Navbar.css';

const Navbar = () => {
    return (
        <div id="navbar-container">
            <nav id="main-navigation">
                <ul id="navbar">
                    <li><NavLink id="movies-tab" className="nav-link" to="/movies">Movies</NavLink></li>
                    <li><NavLink ide="tvshows-tab" className="nav-link current-tab" to="/tvshows">TV Shows</NavLink></li>
                </ul>
            </nav>
        </div>
    );
}

export default Navbar;
